  return (

    <div >
        <Header type={'home'}></Header>
        <div className='w-full h-[400px] border bg-white ' ></div>
        <div className='w-full flex justify-center items-center'><LoginCard ></LoginCard></div>
    </div>
  )
}

export default Home;
